  return (
    <div className="page-container">
      <div>
        <h2 className="title">Now Playing</h2>
      </div>
      <div className="movieItem">
        <img src="" alt="" />
        <h3 className="">Spiderman: Homecoming </h3>
        <div>
          <span>2017</span>
          <span>
            7.4 <FontAwesomeIcon icon={faStar} />
          </span>
        </div>
        <button></button>
      </div>
    </div>
  );
};

export default MoviePlaying;
